import React, { useEffect, useState } from "react";
import "../UserBids/UserBids.css";
import axios from 'axios';
import EditProduct from "../EditProduct/EditProduct";
import DeleteProduct from "../DeleteProduct/DeleteProduct";
import { Link } from "react-router-dom";

function UsersBids(props) {
    const [bidslist, setBidsList] = useState([]);
    useEffect(()=>{
        console.log("Hi");
        const token = localStorage.getItem('token');
        axios.get("http://localhost:5000/bids/user", { headers : {
            Authorization: token,
        }}).then(res => {
            setBidsList(res.data);
            console.log(res.data.length);
        }).catch(err=>{
            console.log(err);
        })
    },[])
    return <div className="vucontainer">
    <ul className="vuresponsive-table">
      <li className="vutable-header">
        <div className="vucol vucol-1">Product</div>
        <div className="vucol vucol-2">Name</div>
        <div className="vucol vucol-3">Seller Details</div>
        <div className="vucol vucol-4">Offered Price</div>
        <div className="vucol vucol-5">Your Bid</div>
        <div className="vucol vucol-6">Placed On</div>
      </li>
      {bidslist.map((bid) => {
        {console.log(bid);}
        return <li className="vutable-row">
        <div className="vucol vucol-1">{bid.productName}</div>
        <div className="vucol vucol-2">productName</div>
        <div className="vucol vucol-3">sellerDetails</div>
        <div className="vucol vucol-4">offeredPrice</div>
        <div className="vucol vucol-5">bidPrice</div>
        <div className="vucol vucol-6">placedOn</div>
  </li>
      })}
      {/* {products.map((product, index) => { */}
        {/* return  */}
        <li className="vutable-row">
            <div className="vucol vucol-1">Col</div>
            <div className="vucol vucol-2">Col</div>
            <div className="vucol vucol-3">Col</div>
            <div className="vucol vucol-4">Col</div>
            <div className="vucol vucol-5">Col</div>
            <div className="vucol vucol-6">Col</div>
      </li>
    </ul>
  </div>;
}

export default UsersBids;
